import React from 'react';
import { Card, Table } from 'react-bootstrap';

const Statistics = ({ nutrients }) => {
    return (
        <Card className="mb-4" style={{ backgroundColor: '#f3f3f3' }}>
            <Card.Header style={{ backgroundColor: '#64b064', color: 'white' }}>Statistics</Card.Header>
            <Card.Body>
                <Table striped bordered responsive>
                    <thead>
                        <tr>
                            <th>Nutrient Name</th>
                            <th>Total Amount</th>
                            <th>Unit</th>
                            <th>% DV</th>
                        </tr>
                    </thead>
                    <tbody>
                        {nutrients.map((nutrient, index) => (
                            <tr key={index}>
                                <td>{nutrient.nutrientName}</td>
                                <td>{nutrient.totalAmount}</td>
                                <td>{nutrient.nutrientUnitName}</td>
                                <td>{nutrient.totalPercentDailyValue}%</td>
                            </tr>
                        ))}
                    </tbody>
                </Table>
            </Card.Body>
        </Card>
    );
};

export default Statistics;
